select * from depot;

create table modele_activite_20150930 as select * from modele_activite;
create table modele_tournee_jour_20150930 as select * from modele_tournee_jour;
create table modele_tournee_20150930 as select * from modele_tournee;
create table groupe_tournee_20150930 as select * from groupe_tournee;
create table reperage_20150930 as select * from reperage;

delete from modele_journal where flux_id=1 and depot_id=13;
delete from modele_activite where flux_id=1 and depot_id=13;
delete mtj from modele_tournee_jour mtj inner join modele_tournee mt on mtj.tournee_id=mt.id inner join groupe_tournee gt on mt.groupe_id=gt.id where flux_id=1 and depot_id=13;
update reperage set tournee_id=null where tournee_id in (select mt.id from modele_tournee mt inner join groupe_tournee gt on mt.groupe_id=gt.id where flux_id=1 and depot_id=13);
delete mt from modele_tournee mt inner join groupe_tournee gt on mt.groupe_id=gt.id where flux_id=1 and depot_id=13;
delete from pai_heure where groupe_id in (select id from groupe_tournee where flux_id=1 and depot_id=13);
delete from groupe_tournee where flux_id=1 and depot_id=13;

